const _bytecode =
  ''

type IFFNFTConstructorParams =
  | [signer?: Signer]
  | ConstructorParameters<typeof ContractFactory>

const isSuperArgs = (
  xs: IFFNFTConstructorParams
): xs is ConstructorParameters<typeof ContractFactory> => xs.length > 1

export class IFFNFT__factory extends ContractFactory {
  constructor(...args: IFFNFTConstructorParams) {
    if (isSuperArgs(args)) {
      super(...args)
    } else {
      super(_abi, _bytecode, args[0])
    }
  }

  override deploy(
    overrides?: Overrides & { from?: PromiseOrValue<string> }
  ): Promise<IFFNFT> {
    return super.deploy(overrides || {}) as Promise<IFFNFT>
  }
  override getDeployTransaction(
    overrides?: Overrides & { from?: PromiseOrValue<string> }
  ): TransactionRequest {
    return super.getDeployTransaction(overrides || {})
  }
  override attach(address: string): IFFNFT {
    return super.attach(address) as IFFNFT
  }
  override connect(signer: Signer): IFFNFT__factory {
    return super.connect(signer) as IFFNFT__factory
  }

  static readonly bytecode = _bytecode
  static readonly abi = _abi
  static createInterface(): IFFNFTInterface {
    return new utils.Interface(_abi) as IFFNFTInterface
  }
  static connect(address: string, signerOrProvider: Signer | Provider): IFFNFT {
    return new Contract(address, _abi, signerOrProvider) as IFFNFT
  }
}
